import React from 'react'
import Recent from './Recent';

import './LongBox.css';

function LongBox() {
    return (
        <div className="longBox">
            <h2>Recent Activity</h2>
            <h3>No Transactions Yet</h3>
            <p>Trades will be displayed in this box!</p>
        </div>
    )
}

export default LongBox
